import Link from "next/link";

const LandingHeader = () => (
  <div className="landing">
    <h1>Woo Young Choi</h1>
    <p>
      I build things for the web. Software engineer based in New York, NY
      specializing in building and designing websites and applications.
    </p>
    <style jsx>
      {`
        .landing {
          color: #00ace6;
          display: block;
          font-family: "Georgia, serif";
          text-align: center;
          margin-left: auto;
          margin-right: auto;
          width: 400px;
        }

        h1 {
          font-size: 30px;
          font-weight: normal;
        }

        p {
          font-size: 15px;
        }
      `}
    </style>
  </div>
);

export default LandingHeader;
